import React from "react";
import { Link } from "react-router-dom";

function Homepage() {
  return (
    <div>
      <h1>Welcome!</h1>
      <p>This is our homepage!</p>
      <Link to="Login">
        <style>padding: 1 px;</style>
        <button>Get Started></button>
      </Link>
    </div>
  );
}

export default Homepage;
